import request from '@/utils/request'

export function getList(id,pageSize,pageNumber,published){
	return request({
		url:'/list',
		method:'get',
		params:{
			id:id,
			pageSize:pageSize,
			pageNumber:pageNumber,
			published:published
		}
	})
}
